INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "アヤネ", 102301, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", "2020/07/31 12:00:00", 0.0, 0.0, 24001, 2, 0.0, 2, 24, 401, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "アヤネ", 102301, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", "2020/07/31 12:00:00", 2.21, 0.0, 24002, 2, 0.0, 1, 24, 402, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "アヤネ", 102301, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", "2020/07/31 12:00:00", 0.0, 0.0, 24003, 2, 0.0, 2, 24, 403, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "アサヒ", 192201, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", "2020/07/31 12:00:00", 1.99, 0.0, 24004, 1, 0.0, 2, 24, 701, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "アサヒ", 192201, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", "2020/07/31 12:00:00", 2.21, 0.0, 24005, 2, 0.0, 1, 24, 702, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "アサヒ", 192201, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", "2020/07/31 12:00:00", 3.33, 0.0, 24006, 1, 0.0, 2, 24, 703, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "部員３", 192301, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", "2020/07/31 12:00:00", 0.0, 0.0, 24007, 2, 0.0, 2, 24, 801, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "部員３", 192301, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", "2020/07/31 12:00:00", 2.68, 0.0, 24008, 2, 0.0, 1, 24, 802, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "部員３", 192301, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", "2020/07/31 12:00:00", 0.0, 0.0, 24009, 2, 0.0, 2, 24, 803, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "", 192501, "やった！", "2020/07/31 12:00:00", 0.0, 0.0, 24010, 1, 0.0, 1, 24, 501, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "", 192501, "勝ったよ！", "2020/07/31 12:00:00", 0.0, 0.0, 24011, 1, 0.0, 1, 24, 502, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "", 192501, "いい調子！", "2020/07/31 12:00:00", 0.0, 0.0, 24012, 1, 0.0, 1, 24, 503, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "ミサト", 113501, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", "2020/07/31 12:00:00", 5.33, 0.0, 24013, 2, 0.0, 6, 24, 111, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "ミサト", 113501, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", "2020/07/31 12:00:00", 6.85, 0.0, 24014, 2, 0.0, 1, 24, 112, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "ミサト", 113501, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", "2020/07/31 12:00:00", 3.0, 0.0, 24015, 2, 0.0, 1, 24, 113, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "ダイチ", 192401, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", "2020/07/31 12:00:00", 6.11, 0.0, 24016, 2, 0.0, 1, 24, 611, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "ダイチ", 192401, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", "2020/07/31 12:00:00", 6.75, 0.0, 24017, 2, 0.0, 1, 24, 612, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "ダイチ", 192401, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", "2020/07/31 12:00:00", 0.0, 0.0, 24018, 2, 0.0, 2, 24, 613, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "ハツネ", 113401, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", "2020/07/31 12:00:00", 4.52, 0.0, 24019, 1, 0.0, 2, 24, 211, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "ハツネ", 113401, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", "2020/07/31 12:00:00", 3.89, 0.0, 24020, 1, 0.0, 2, 24, 212, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "ハツネ", 113401, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", "2020/07/31 12:00:00", 13.49, 0.0, 24021, 2, 0.0, 1, 24, 213, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "カヤ", 106501, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", "2020/07/31 12:00:00", 3.17, 0.0, 24022, 2, 0.0, 1, 24, 311, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "カヤ", 106501, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", "2020/07/31 12:00:00", 4.42, 0.0, 24023, 2, 0.0, 1, 24, 312, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "カヤ", 106501, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", "2020/07/31 12:00:00", 2.89, 0.0, 24024, 1, 0.0, 6, 24, 313, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "アヤネ", 102301, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", "2020/07/31 12:00:00", 3.71, 0.0, 24025, 3, 0.0, 4, 24, 421, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "アサヒ", 192201, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", "2020/07/31 12:00:00", 5.1, 0.0, 24026, 1, 0.0, 2, 24, 721, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "部員３", 192301, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", "2020/07/31 12:00:00", 4.34, 0.0, 24027, 3, 0.0, 1, 24, 821, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "", 192501, "いい勝負だったよ\nまたやろうね", "2020/07/31 12:00:00", 0.0, 0.0, 24028, 1, 0.0, 1, 24, 521, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "ミサト", 113501, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", "2020/07/31 12:00:00", 5.62, -360.0, 24029, 2, 0.0, 1, 24, 101, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "ミサト", 113501, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", "2020/07/31 12:00:00", 9.58, -360.0, 24030, 2, 0.0, 1, 24, 102, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "ミサト", 113501, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", "2020/07/31 12:00:00", 0.0, -360.0, 24031, 2, 0.0, 2, 24, 103, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "ミサト", 113501, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", "2020/07/31 12:00:00", 9.13, -360.0, 24032, 1, 0.0, 2, 24, 104, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (10046, "ミサト", 113501, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", "2020/07/31 12:00:00", 8.27, -360.0, 24033, 2, 0.0, 1, 24, 105, "2030/12/17 14:59:59");
